MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "");
MGCAddSnippet(3, "The following sections in this chapter provide useful information for this release:");
MGCAddSnippet(4, "These release notes provide release information for the following areas:");
MGCAddSnippet(5, "A support contract with Siemens Digital Industries Software is a valuable investment in your organization s success. With a support contract, you have 24/7 access to the comprehensive and personalized Support Center portal.");
MGCAddSnippet(6, "The Siemens EDA training catalog contains a large variety of instructor-led courses. Classes are available in Siemens Digital Industries Software worldwide training centers, onsite at your workplace, and online with live instructors. ");
MGCAddSnippet(7, "You can view a complete list of this release s corrected defects and known issues on Support Center.");
MGCAddSnippet(8, "If you are a registered Support Center user, you can open a new support case and view the status of your own support cases, including the status of any attached Defect Report (DR) or Enhancement Request (ER). You can also view all support cases for your site, including all associated DRs and ERs.");
MGCAddSnippet(9, "The following sections provide general information about the Calibre release: ");
MGCAddSnippet(10, "The Calibre Platform Support Overview and Roadmap provides the latest information on hardware architectures and operating systems that Calibre currently supports and intends to support in the upcoming year. The roadmap is accessible at:");
MGCAddSnippet(11, "Support for the RHEL 5 operating system was deprecated starting with the 2017.1 release and is discontinued with the 2021.1 release.");
MGCAddSnippet(12, "The 2021.1 Calibre release includes support for Red Hat Enterprise Linux version 8 (RHEL 8). The Calibre software for the RHEL 8 operating system is packaged into the AOK executable.");
MGCAddSnippet(13, "With the 2019.2 release, the AOI and AOJ Calibre trees use MGLS v2018_2, which requires the FlexNet v11.16.0 licensing software.");
MGCAddSnippet(14, "The Google Chrome browser is not supported on the RHEL 6 operating system. Using Chrome may cause core files to be written. ");
MGCAddSnippet(15, "This chapter provides information on accessing product documentation, in addition to describing the 2021.2 changes and enhancements for Calibre documentation and related products.");
MGCAddSnippet(16, "The Calibre documentation includes user, reference, quick reference cards, and process documentation in both HTML and PDF formats to offer you the various features and benefits of each format. The actual content does not vary between the formats. ");
MGCAddSnippet(17, "The Calibre documentation is packaged with the Calibre software tree for both the software CD and software download file. The installation process automatically installs the documentation at the same level as the Calibre software tree. The Calibre software tree contains a link to the documentation directory.");
MGCAddSnippet(18, "The following documentation changes are effective with the Calibre 2021.2 release. ");
MGCAddSnippet(19, "The documentation has some known problems and workarounds. ");
MGCAddSnippet(20, "When browsing documentation, some links between PDF manuals do not resolve when using Adobe Reader version 8 or 9 on Linux. If you encounter this issue, the workaround is to use Adobe Reader on Windows or Mac OS.");
MGCAddSnippet(21, "The Linux version of Adobe® Reader is no longer available for download from Adobe. The Calibre InfoHub and HTML documentation are included with the Calibre software tree as a solution for accessing and searching the user documentation in a Linux environment. The InfoHub and HTML documentation provide both global search and support of linking between documents. By default, the mgcdocs command and GUI Help menu items will invoke the Calibre InfoHub. ");
MGCAddSnippet(22, "Due to enhanced security restrictions with web browser PDF plug-ins, some links do not function. Links in HTML documentation are fully functional. ");
MGCAddSnippet(23, "We welcome your feedback on the Calibre documentation. A link to a Documentation Feedback form is available at the end of the bookmark list for all PDF documents. For HTML documents, the link is at the end of the title page. ");
MGCAddSnippet(24, "The following sections in this chapter provide information on Calibre examples:");
MGCAddSnippet(25, "Tutorials and eKits contain design data, rule files, and instructions for running and learning more about the tool. ");
MGCAddSnippet(26, "The following steps describe how to download and install Calibre tutorials and eKits.");
MGCAddSnippet(27, "The Calibre InfoHub and documentation includes links to the several getting started and how-to videos. ");
MGCAddSnippet(28, "The Calibre documentation is continually being enhanced with new examples. ");
MGCAddSnippet(29, "This chapter provides information about updates to general Calibre products and operation.");
MGCAddSnippet(30, "This section describes the 2021.2 changes to the CalibreFullScale platform.");
